import React from 'react';

const About = () => {
    return (
        <div className="text-center">
            <h5>About Us</h5>
            <h1>We Provide An Ideal Home Environment</h1>
            <p>We provide home for the elderly people.We have dedicated volunteers will help to look after them</p>
            <iframe width="560" height="315" src="https://www.youtube.com/embed/igKdgta23gg" title="YouTube video player" frameborder="0" allow="accelerometer; autoplay; clipboard-write; encrypted-media; gyroscope; picture-in-picture" allowfullscreen></iframe>
            <br />
            <button className="regular-btn mt-3">Read More
                <span><i class="fas fa-arrow-right ms-2"></i></span>
            </button>
        </div>
    );
};

export default About;
